sys_variable_value.value:
(function execute(inputs, outputs) {
  var response = JSON.parse(inputs.responsebody);

  if(inputs.statuscode == "200" || inputs.statuscode == "201")
  {
    if(response.result.length != 0)
    {
      outputs.group = "0";
    }
    outputs.statuscode = "0";
  } 
  else 
  {
    outputs.statuscode = "1";
    outputs.error = inputs.errormessage;
    outputs.group = "1";
  }
})(inputs, outputs);

